  name="",
  onChange,
  checked=""
}) => {
  return (
    <div className={`checkbox ${className}`}>
      <input type="checkbox" className="checkbox__item" name={name} value={value} onChange={onChange} checked={checked}/>
        <label for="checkbox">{label}</label>
    </div>
  );
}

export default Checkbox;
